import logo from './logo.svg'
import './App.css'
import { useEffect } from 'react'

function App() {
  useEffect(() => {
    fetch('https://pokeapi.co/api/v2/pokemon/?limit=20')
      .then((response) => response.json())
      .then((data) => {
        console.log(data)
      })
      .catch((err) => {
        console.log(err.message)
      })
  }, [])

  return <div className="App"></div>
}

export default App
